Presented in partnership with Oprah Winfrey’s all-time favourite guest Dr. Tererai Trent these awards recognise the incredible women from around the world working to make a difference. The Women Changing the World Awards will be announced in London on 18 April and are open to women from all over the globe who are working to make the world a better place through the work that they do. If you know an incredible woman changing the world, let us know by nominating her at wcwawards.com ♥️

